note.body:
@mkasik The change in that commit is unrelated to this issue here. That commit just switches the default for a preference, that is submitted to the server, not affecting this issue here.

What seems to be wrong though, is that gtk-frdp uses BGRA as cairo format for BGRX surfaces here, instead of BGRX: https://gitlab.gnome.org/GNOME/gtk-frdp/-/blob/master/src/frdp-session.c#L627  
That was also an issue in the past with Remmina and caused artifacts there as well. This should be changed to use BGRX (BGRA is only for BGRA surfaces, which are usually only used in RAIL mode (Connections does not support RAIL, so this can be switched without a problem (BGRA -> BGRX))).
